import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import TodoList from "./components/todolist";

const App = () => {
	return (
		<Container className='m'>
			<Row>
				<Col>
					<TodoList/>
				</Col>
			</Row>
		</Container>
	);
};

export default App;
